    [],nt"num_tags": 0,nt"name": "commercial-landing-system",nt"isopen":
    false,nt"url": null,nt"notes": "The Fisheries Statistics Division of the
    NOAA Fisheries has automated data summary programs that anyone can use to rapidly
    and easily summarize U.S. commercial fisheries landings.nnThese programs allow you
    to query our commercial fishery data bases and summarize United States domestic
    commercial landings in several formats. Domestic fishery landings are those fish
    and shellfish that are landed and sold in the 50 states by U.S. fishermen and do
    not include landings made in U.S. territories or by foreign fishermen. You can summarize
    the pounds and dollar value of commercial landings by your choice of years, months,
    states and species for the years 1990 onwards. The volume and value of 1950 onwards
    landings can be summarized by: years, states and species; by years, states, species
    and fishing gears; or years, states, species, finfish or shellfish groups, and price
    per pound.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
